import { useState } from 'react';
import axios from 'axios';
import Product from '../components/product';


const Home = () => {
  const getData = async (n: number) => {
    const {headers, data} = await axios.get(`http://0.0.0.0:8080/products/?_page=${n}`);
    console.log(data, '\n', 'total:', headers['x-total-count']);
  }
  getData(1);
  return (
    <div>
      Hi
      <Product />
    </div>
  );
};

export default Home;
